import React from 'react';
import Card from"./Card";

import style from "./styles/Cards.module.css";

const Cards = ({ countries }) => {
    return(
        <div className={style.cardContainer}>
            { countries.length > 0 ? ( 
                countries?.map((e) => {
                    return (
                        <Card
                            key={e.cca3}
                            id={e.cca3}
                            name={e.name}
                            flags={e.flags}
                            continents={e.continents}
                        />
                    );
                })
            ) : (
                <div>
                    <h1>HOLAA</h1>
                </div>
            )
            }
        </div>
    );
};

export default Cards;
